رُکُن کَتھ:Tajamul9 [اؠڈِٹ] السلام عليكم تٖ پرنآم! Syed Shial12 . مےٚ وُچھ تُہُنٛد شِرکَت تہ چھُ یَژھن تُہؠ خٲر مَقدَم کرُن. مےٛ چھِ وومید زِ تُہؠ کریو ویکیپیڈیاہس پیٹھ اصل کٲم. تُہؠ ہیکو مَدَد یمن جاین حٲصل کٕریتھ: اگر تُہؠ چھِ کینٛہہ سوال، ٲسۍ چھِ اکھ مِلَن سار جاے ییٚتِؠتھ تُہؠ تَجرُبہٕ کار رُکُنن نِش مَدَر ہیکو حٲصل کٕریتھ: تُہؠ ہیکو یمن جاین مَدَر کٕریتھ: مہربٲنی کٔرِتھ تھٲیو یاد دَستخَط کَرُن بَحَژ صَفہن پیٹھ یٕمو (~~~~) سٲتۍ؛ پَزیَہ یہِ پٲنۍ پانے تٔمِس بَناوُن تُہُنٛد ناو تٖ سۄ تٲریٖخ. اؠ
..........
) --ہَلجِڑ (کَتھ) 16:32, 15 جَنؤری 2022 (UTC) [اؠڈِٹ] السلام عليكم تہٕ پرنآم! Tajamul9. تُہُند عرضی مُعٲینہٕ کَرنہٕ پَتٕہ چھُ مےٚ کۆرمُت تُہُند کھاتہٕ رولبیک حَق باپت . یِمن کَتھن ہُنٛد گَژھہ خَیال یُن تھاونہٕ:- رولبیک حَق گَژھہ صِرِف فضوٗل تہٕ بَکواس اؠڑِٹن پیٹھ اِستِعمال کَرنہٕ یُن. - یہ رُکُن حَق گَژھہ نہ اؠڈِٹ جَنٛگ مَنٛز اِستِعمال کرنہٕ یُن. - غَلط اِستِعمال کرنَس پیٹھ ییہِ یہ حَق واپس نِنہٕ. - دؠماغ کٕرو اِستِعمال. اگر تُہؠ یہ رُکُن حَق چھُ نہ صروٗرَت تُہی ہیکو مےٚ سٲتؠ رٲبطہٕ کٕریتھ. مےٚ
